} Implementing these traits is a significant hurdle, as it requires the use of Pin. It also means that people cannot leverage .await syntax or other niceties that they are accustomed to. (See Alan hates writing a stream for a narrative description.) It would be nice if we could rework those traits to use async fn. Today that is only possible using the async_trait procedural macro: #[async_trait]
